    newGrades.map((grade) => {
      if (grade.studentId === student.id) {
        student.grade = grade.grade;
      }
      if (!student.hasOwnProperty('grade')) {
        student.grade = 'N/A';
      }
      return student;
    });
    return student;
  });
  return filtered;
}

